import React from "react";
import "./WebsiteFooter.scss";
import logo from "./logo.png";

function Footer() {
  return (
    <div className="websitefooter">
      <div className="left">
        <img className="left-image" src={logo}></img>
      </div>
      <div className="footer-title"> Contant Infomation:</div>
      <div className="footer-content"> Email: abc@ucsd.edu</div>
      <div className="footer-content"> Phone Number: 123-456-7890</div>
      <div className="footer-content"> Address: put address here</div>
      {/* <div className="footer-map">My map will go here</div> */}
    </div>
  );
}

export default Footer;
